import './home.css';
import {useFetch} from '../../hooks/useFetch'

const Home = () => {
    const { data, error, isPending } = useFetch('https://jsonplaceholder.typicode.com/users')
    
    
    return (
        <div>
            {error && <p>couldn't load {error}</p>}
            {isPending && <h1>Loadding</h1>}
            {data && data.map(val => (
                <div key={val.id} className="card-container">
                    <h1>{val.name}</h1>
                    <p>{val.email}</p>
                </div>
            ))}
        </div>
    );
}

export default Home;
